import React from 'react'
import { Link } from 'react-router-dom';


const ListItem = ({note}) => {
     // {note}instead of props, is desctructuring
     // it's direct utilisation of attribute assigned in JSX
  return (
    <div>
      <Link to ={`/note/${note.id}`}>
         <h3>{note.body}</h3>
      </Link>
    </div>
  )
}

export default ListItem
